CREATE TABLE `bot_info_zone` (
`id` int(5) unsigned NOT NULL,
`name` varchar(100) NOT NULL,
`minlevel` int(3) unsigned NOT NULL,
`maxlevel` int(3) unsigned NOT NULL,
`territory` int(1) unsigned NOT NULL,
PRIMARY KEY (`id`)
);

CREATE TABLE `bot_info_position` (
`id` int(5) unsigned NOT NULL,
`x` float NOT NULL,
`y` float NOT NULL,
`z` float NOT NULL,
`mapid` int(3) unsigned NOT NULL,
`zoneid` int(5) unsigned NOT NULL,
`minlevel` int(3) unsigned NOT NULL,
`maxlevel` int(3) unsigned NOT NULL,
`territory` int(1) unsigned NOT NULL,
PRIMARY KEY (`id`)
);


